import React from "react";
import { Navbar, Hero, Card } from "./Components/Component";
import data from "./data";

const App = () => {
  const cards = data.map((item) => {
    <Card
      img={data.coverImg}
      rate={data.stats.rating}
      count={data.stats.reviewCount}
      place={data.location}
      title={data.title}
      price={data.price}
    />;
  });

  return (
    <section className="container">
      <Navbar />
      <Hero />
      <div>{cards}</div>
    </section>
  );
};

export default App;
